import React from "react";
import * as myProjectService from "../services/myProjectService";
import {
  Card,
  CardHeader,
  CardBody,
  CardTitle,
  CardFooter,
  Row,
  Col
} from "reactstrap";

import CardAuthor from "components/CardElements/CardAuthor.jsx";
import FormInputs from "components/FormInputs/FormInputs.jsx";
import Button from "components/CustomButton/CustomButton.jsx";

class Register extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      firstName: "",
      lastName: "",
      certifications: "",
      specializations: "",
      yogaStyle: "",
      bio: "",
      rates: "",
      location: "",
      website: "",
      email: "",
      phone: ""
    };
  }

  handleChange = e => {
    this.setState({
      [e.target.name]: e.target.value
    });
  };

  onSubmit = e => {
    e.preventDefault();
    // console.log(values);
    debugger;
    const payload = {
      firstName: this.state.firstName,
      lastName: this.state.lastName,
      certifications: this.state.certifications,
      specializations: this.state.specializations,
      yogaStyle: this.state.yogaStyle,
      bio: this.state.bio,
      rates: this.state.rates,
      location: this.state.location,
      image: this.state.image,
      website: this.state.website,
      email: this.state.email,
      phone: this.state.phone
    };

    myProjectService
      .submitProfile(payload)
      .then(this.onSuccess)
      .catch(this.onError);
  };

  onSuccess = () => {
    console.log("successful ya");
  };

  onError = () => {
    console.log("boo boo");
  };

  render() {
    return (
      <React.Fragment>
        {/* <br />
        <br />
        <br /> */}

        <Card className="card-user">
          <CardHeader>
            <CardTitle>
              <h3 className="title text-center">Register</h3>
            </CardTitle>
          </CardHeader>
          <CardBody>
            <form>
              <FormInputs
                type="text"
                className="form-control"
                placeholder="First Name"
                name="firstName"
                id="form-firstName"
                data-error="Subject field is required"
                required
                values={this.state.firstName}
                onChange={e => this.handleChange(e)}
                ncols={["col-md-6 pr-1", "col-md-6 pl-1"]}
                proprieties={[
                  {
                    label: "First Name",
                    inputProps: {
                      type: "text",
                      placeholder: "First Name",
                      defaultValue: "Chet"
                    }
                  },
                  {
                    label: "Last Name",
                    inputProps: {
                      type: "text",
                      placeholder: "Last Name",
                      defaultValue: "Faker"
                    }
                  }
                ]}
              />
              <FormInputs
                ncols={["col-md-5 pr-1", "col-md-3 px-1", "col-md-4 pl-1"]}
                proprieties={[
                  {
                    label: "Website",
                    inputProps: {
                      type: "text",
                      // disabled: true,
                      defaultValue: "Enter URL.."
                    }
                  },
                  {
                    label: "Phone number",
                    inputProps: {
                      type: "text",
                      defaultValue: "xxx-xxx-xxxx"
                    }
                  },
                  {
                    label: "Email address",
                    inputProps: {
                      type: "email",
                      placeholder: "Email"
                    }
                  }
                ]}
              />

              <FormInputs
                ncols={["col-md-12"]}
                proprieties={[
                  {
                    label: "Certifications",
                    inputProps: {
                      type: "text",
                      placeholder: "ex. 200hr, 500hr.."
                      // defaultValue: ""
                    }
                  }
                ]}
              />
              <FormInputs
                ncols={["col-md-12"]}
                proprieties={[
                  {
                    label: "Specializations",
                    inputProps: {
                      type: "text",
                      placeholder: "ex. Prenatal.."
                      // defaultValue: ""
                    }
                  }
                ]}
              />

              <FormInputs
                ncols={["col-md-4 pr-1", "col-md-4 px-1", "col-md-4 pl-1"]}
                proprieties={[
                  {
                    label: "Yoga Style",
                    inputProps: {
                      type: "text",
                      // defaultValue: "Melbourne",
                      placeholder: "ex. Restorative Yoga.."
                    }
                  },
                  {
                    label: "Rates",
                    inputProps: {
                      type: "text",
                      // defaultValue: "Australia",
                      placeholder: "ex. $125/hr"
                    }
                  },
                  {
                    label: "Location",
                    inputProps: {
                      type: "text",
                      placeholder: "City or Zip Code"
                    }
                  }
                ]}
              />
              <FormInputs
                ncols={["col-md-12"]}
                proprieties={[
                  {
                    label: "Bio",
                    inputProps: {
                      type: "textarea",
                      // defaultValue:
                      //   "Oh so, your weak rhyme You doubt I'll bother, reading into it",
                      placeholder: "Enter brief bio.."
                    }
                  }
                ]}
              />
              <Row>
                <div className="update ml-auto mr-auto">
                  <Button color="primary" round>
                    Update Profile
                  </Button>
                </div>
              </Row>
            </form>
          </CardBody>
        </Card>
      </React.Fragment>
    );
  }
}

export default Register;
